import React from 'react';
import './Footer.css';
import logo from './../../images/logo-horizontal-branco.png';

const Footer = (props) => {
  return (
    <footer>
      <img src={logo} alt="ZeeDog"/>
    </footer>
  );
}

export default Footer;
